function generarPDFCanvas(doc, canvas_id, title, despAmplada, despAlcada, amplada, altura) {
    //Canvas = document.getElementById("idChartContainer");
    //Context = Canvas.getContext("2d");
    doc = afegirTextCentrat(title, despAlcada - 15, doc, 45);
    var element = document.getElementById(canvas_id).toDataURL();
    //
    //var imgData = Canvas.toDataURL('image/jpeg');
    doc.addImage(element, 'JPEG', despAmplada, despAlcada, amplada, altura, null);
    return doc;
}

function afegirTaula(marginTop, marginLeft, startY, fontSize, nameTable, doc) {
    $('#' + nameTable).find('tbody').prepend("<tr class='row100 body'><td class='cell100 column1' style='display:inline-block; width: 15px; margin-top: 10px; margin-bottom: 10px; border: 1px solid black; margin-left: 10px; border-radius: 10px;' bgcolor='@IoT_Web.Startup.States.es.getColorEstatMaquina(state.StateID.ToString())'></td><td class='cell100 column2'><div title='Lorem ipsum dolor sit amet, consectetur adipiscing elit, sed do eiusmod tempor incididunt ut labore et dolore magna aliqua. Ut enim ad minim veniam'>Estado</div></td><td class='cell100 column3' style='width:auto'>Tiempo</td><td class='cell100 column4'>%</td></tr>");
    var options = {
        margin: {
            top: marginTop,
            left: marginLeft
        },
        startY: startY,
        styles: { fontSize: fontSize, width: 200 }
    };
    data = doc.autoTableHtmlToJson(document.getElementById(nameTable), false);
    doc.autoTable(data.columns, data.rows, options);
    $('#' + nameTable).find('tr:first-child').remove();

    return doc;
}

function generarPDF(div_id, title, doc, x, y, w, h, callback) {
    var doctype = '<?xml version="1.0" standalone="no"?>'
        + '<!DOCTYPE svg PUBLIC "-//W3C//DTD SVG 1.1//EN" "http://www.w3.org/Graphics/SVG/1.1/DTD/svg11.dtd">';

    // serialize our SVG XML to a string.
    var source = (new XMLSerializer()).serializeToString(d3.select(div_id).select("svg").node());

    // create a file blob of our SVG.
    var blob = new Blob([doctype + source], { type: 'image/svg+xml;charset=utf-8' });

    var url = window.URL.createObjectURL(blob);

    // Put the svg into an image tag so that the Canvas element can read it in.
    var img = d3.select(div_id).append('img')
        //.attr('width', Number(d3.select(div_id).style("width").slice(0, -2)) * 1.1)
        //.attr('height', Number(d3.select(div_id).style("height").slice(0, -2)) * 1.1)
        .attr('width', w)
        .attr('height', h)
        .node();

    var canvas = d3.select(div_id).append('canvas').node();
    canvas.width = w * 3// Number(d3.select(div_id).style("width").slice(0, -2)) * 1.1;
    canvas.height = h * 3//Number(d3.select(div_id).style("height").slice(0, -2)) * 1.1
    //canvas.width =  Number(d3.select(div_id).style("width").slice(0, -2)) ;
    //canvas.height = Number(d3.select(div_id).style("height").slice(0, -2))

    var ctx = canvas.getContext('2d');
    //ctx.clearRect(0, 0, canvas.width-20, canvas.height-80);
    //ctx.fillStyle = "#FFFFFF";
    //ctx.fillRect(0, 0, canvas.width-20, canvas.height-220);
    img.onload = function () {
        // Now that the image has loaded, put the image into a canvas element.
        ctx.drawImage(img, 0, 0);
        doc = afegirTextCentrat(title, y - 15, doc, 45);
        doc = afegirImatge(canvas, x, y, w, h, null, doc);
        callback(doc)
        canvas.remove();

    }
    // start loading the image.

    img.src = url;

    img.style.display = "none";
};
function afegirImatge(image, despAmplada, despAlcada, amplada, altura, nomImatge, doc) {
    doc.addImage(image, 'PNG', despAmplada, despAlcada, amplada, altura, nomImatge);
    return doc;
};
function convertMS(ms) {
    days = Math.floor(ms / (24 * 60 * 60 * 1000));
    daysms = ms % (24 * 60 * 60 * 1000);
    hours = Math.floor((daysms) / (60 * 60 * 1000));
    hoursms = ms % (60 * 60 * 1000);
    minutes = Math.floor((hoursms) / (60 * 1000));
    minutesms = ms % (60 * 1000);
    sec = Math.floor((minutesms) / (1000));
    return days + " dias " + hours + " horas " + minutes + " minutos " + sec + " segundos";
}

function convertMSGrafica(ms) {
    days = Math.floor(ms / (24 * 60 * 60 * 1000));
    daysms = ms % (24 * 60 * 60 * 1000);
    hours = Math.floor((daysms) / (60 * 60 * 1000));
    hoursms = ms % (60 * 60 * 1000);
    minutes = Math.floor((hoursms) / (60 * 1000));
    return days * 24 + hours + " h " + minutes + " min ";
}

function newDocLogo(nameCompany, dataInici, dataFinal, title, duracion, textEmpresa, textPeriode, textDuracio) {
    var doc = new jsPDF('p', 'pt', 'a4');
    //Afegim logo TAVIL

    var imatge = "data:image/png;base64,";
    doc = afegirImatge(imatge, 15, 15, 140, 20, 'PNG', doc);
    //Afegim període informe i client
    doc = assignarSizeText(11, doc);
    doc.setFontType("normal");
    doc = afegirText(textEmpresa + ": " + nameCompany, (doc.internal.pageSize.width / 2) + 35, 60, doc, 45);
    doc = afegirText(textPeriode + ": " + dataInici + " - " + dataFinal, (doc.internal.pageSize.width / 2) + 35, 20, doc, 45);
    doc = afegirText(textDuracio + ": " + duracion, (doc.internal.pageSize.width / 2) + 35, 40, doc, 45);
    //Afegim títol informe (nom màquina o línia)
    doc = assignarSizeText(30, doc);
    doc = afegirTextCentrat(title, 110, doc, 45);
    //Definir fonts generals del doc
    doc.setFontSize(16);
    doc.setFontType("bold");

    return doc;
}

function afegirTaulaSiPlena(marginTop, marginLeft, startY, fontSize, nameTable, doc) {
    $('#' + nameTable).find('tbody').prepend("<tr class='row100 head row100-head'><th style='width: 10%'>ID</th><th style='width: 5%'>Duracion</th><th style='width: 36%'>Inicio alarma</th><th style='width: 13%'>Finl alarma</th></tr>");
    var linies = document.getElementById(nameTable).getElementsByTagName("tr").length;
    if ((linies - 1) > 0) {
        var options = {
            margin: {
                top: marginTop,
                left: marginLeft
            },
            startY: startY,
            styles: { fontSize: fontSize }
        };
        data = doc.autoTableHtmlToJson(document.getElementById(nameTable), false);
        doc.autoTable(data.columns, data.rows, options);
    }
    $('#' + nameTable).find('tr:first-child').remove();
    return doc;
}

function assignarSizeText(tamany, doc) {

    doc.setFontSize(tamany);
    return doc;
}

function afegirTextCentrat(text, posicioY, doc, fontColor) {
    var fontSize = doc.internal.getFontSize();
    var pageWidth = doc.internal.pageSize.width;
    txtWidth = doc.getStringUnitWidth(text) * fontSize / doc.internal.scaleFactor;
    posicioX = (pageWidth - txtWidth) / 2;

    doc.text(posicioX, posicioY, text, { fontColor: fontColor });

    return doc;
}

function afegirText(text, posicioX, posicioY, doc, fontColor) {

    doc.text(posicioX, posicioY, text, { fontColor: fontColor });

    return doc;
}

function saltarDePagina(doc) {

    doc.addPage();
    return doc;
}

function saltarDePaginaHoritzontal(doc) {

    doc.addPage('a3', 'landscape');
    return doc;
}
function addDataCorner(doc, dataInici, dataFinal, posicioX, posicioY) {
    doc = assignarSizeText(8, doc);
    doc = afegirText("[" + dataInici + " - " + dataFinal + "]", posicioX, posicioY, doc, 45);//Inserim les dates a la gràfica
    doc = assignarSizeText(16, doc);
    return doc;
}